<?php
declare(strict_types=1);

namespace easy\String;

use App\Easy\String\ValidPalindromeTwo;
use PHPUnit\Framework\TestCase;
use function PHPUnit\Framework\assertEquals;

class ValidPalindromeTwoTest extends TestCase
{
    public function testInvoke()
    {
        assertEquals(true, (new ValidPalindromeTwo())('aba'));
        assertEquals(true, (new ValidPalindromeTwo())('abca'));
        assertEquals(false, (new ValidPalindromeTwo())('abc'));
        assertEquals(true, (new ValidPalindromeTwo())('cbbcc'));
        assertEquals(true, (new ValidPalindromeTwo())(''));
    }
}